// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ServiceAgreement {
    enum Status {
        Created,
        Accepted,
        InProgress,
        Paused,
        Completed,
        Canceled
    }

    struct Party {
        bool accepted;
        bool isLawyer;
    }

    struct Service {
        address client;
        address provider;
        string description;
        uint256 value;
        Status status;
        bool legallyRecognized;
    }

    string public clientName;
    string public providerName;
    address public intermediary;
    address public lawyer;
    string public ipfsTermsLink;

    mapping(address => Party) public parties;
    Service public service;

    event ServiceStarted();
    event ServicePaused();
    event ServiceResumed();
    event ServiceCompleted();
    event LegalRecognition(address lawyer);
    event ServicePaid(address payer, uint256 amount);
    event ContractCanceled(address by);

    modifier onlyClient() {
        require(msg.sender == service.client, "Only client can perform this action");
        _;
    }

    modifier onlyProvider() {
        require(msg.sender == service.provider, "Only provider can perform this action");
        _;
    }

    modifier onlyLawyer() {
        require(parties[msg.sender].isLawyer, "Only lawyer can perform this action");
        _;
    }

    modifier onlyParty() {
        require(
            msg.sender == service.client || msg.sender == service.provider,
            "Only involved parties can perform this action"
        );
        _;
    }

    constructor(
        string memory _clientName,
        string memory _providerName,
        address _client,
        address _provider,
        address _intermediary,
        address _lawyer,
        string memory _description,
        uint256 _value,
        string memory _ipfsTermsLink
    ) {
        clientName = _clientName;
        providerName = _providerName;
        intermediary = _intermediary;
        lawyer = _lawyer;
        ipfsTermsLink = _ipfsTermsLink;

        service = Service({
            client: _client,
            provider: _provider,
            description: _description,
            value: _value,
            status: Status.Created,
            legallyRecognized: false
        });

        parties[_client] = Party({accepted: true, isLawyer: false});
        parties[_provider] = Party({accepted: false, isLawyer: false});
        parties[_lawyer] = Party({accepted: false, isLawyer: true});
    }

    function acceptContract() public {
        require(
            msg.sender == service.provider || parties[msg.sender].isLawyer,
            "Only provider or lawyer can accept"
        );
        parties[msg.sender].accepted = true;
        if (service.status == Status.Created) {
            service.status = Status.Accepted;
        }
    }

    function startService() public onlyClient {
        require(parties[service.client].accepted, "Client has not accepted");
        require(parties[service.provider].accepted, "Provider has not accepted");
        service.status = Status.InProgress;
        emit ServiceStarted();
    }

    function pauseService() public onlyClient {
        require(service.status == Status.InProgress, "Service not in progress");
        service.status = Status.Paused;
        emit ServicePaused();
    }

    function resumeService() public onlyProvider {
        require(service.status == Status.Paused, "Service not paused");
        service.status = Status.InProgress;
        emit ServiceResumed();
    }

    function completeService() public onlyProvider {
        require(service.status == Status.InProgress, "Service not in progress");
        service.status = Status.Completed;
        emit ServiceCompleted();
    }

    function legallyRecognize() public onlyLawyer {
        require(service.status == Status.Completed, "Service not completed");
        service.legallyRecognized = true;
        emit LegalRecognition(msg.sender);
    }

    function payService() public payable onlyClient {
        require(service.status == Status.Completed, "Service not completed");
        require(service.legallyRecognized, "Contract not legally recognized");
        require(msg.value >= service.value, "Insufficient payment");
        payable(service.provider).transfer(msg.value);
        emit ServicePaid(msg.sender, msg.value);
    }

    function cancelContract() public onlyParty {
        require(service.status != Status.Completed, "Cannot cancel after completion");
        require(
            service.status == Status.Created || service.status == Status.Accepted,
            "Cannot cancel while in progress"
        );
        service.status = Status.Canceled;
        emit ContractCanceled(msg.sender);
    }

    function getServiceStatus() public view returns (string memory) {
        if (service.status == Status.Created) return "Created";
        if (service.status == Status.Accepted) return "Accepted";
        if (service.status == Status.InProgress) return "In Progress";
        if (service.status == Status.Paused) return "Paused";
        if (service.status == Status.Completed) return "Completed";
        if (service.status == Status.Canceled) return "Canceled";
        return "Unknown";
    }
}

